export default function getLineData(data) {
  let profileList = [];

  data['data'].forEach(profile => {
    profileList.push([
      {
        type: "extension",
        index: "Line",
        data: (() => {
          try {
            let destruct = profile['data']['pattern'];
            return destruct ? destruct : "";
          }
          catch {return ""};
        })()
      },
      {
        index: "Alerting Name",
        data: (() => {
          try {
            let destruct = profile['data']['alertingName']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Description",
        data: (() => {
          try {
            let destruct = profile['data']['description']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Device",
        data: (() => {
          try {
            let destruct = profile['data']['associatedDevices']['device'][0]
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Calling Search Space",
        data: (() => {
          try {
            let destruct = profile['data']['shareLineAppearanceCssName']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Forward",
        data: (() => {
          try {
            let destruct = profile['data']['callForwardAll']['destination']
            if (destruct === null) {
              let vm = profile['data']['callForwardAll']['forwardToVoiceMail']
              return vm ? "Voicemail": "None"
            }
            return destruct
          }
          catch {return ""}
        })()
      },
      {
        index: "Location",
        data: (() => {
          try {
            let destruct = profile['meta']['hierarchy']
            destruct = destruct.split("London Drugs.")[1]
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      }
    ])
  })

  return new Promise((resolve, reject) => {
    resolve(profileList)
    reject("Unable to retrieve lines.")
  })
}
